import image1 from "./welcome/welcome_page_1.png";
import image2 from "./welcome/welcome_page_2.png";
import image3 from "./welcome/welcome_page_3.png";

const imageData = [
    {
        label : "Image1",
        alt: "image1",
        url: image1,
    },
    {
        label : "Image2",
        alt: "image2",
        url: image2,
    },
    {
        label : "Image3",
        alt: "image3",
        url: image3,
    }
]

export default imageData;
